Did you know that Everton FC wasn’t always Everton FC?
Back in the late 1800s, the parish of St. Domingo’s Methodist Church created a cricket team for recreational purposes. However, since cricket was primarily played in the summer, a winter game could be added. Thus, Rev. Ben Swift Chambers ushered in the formation of a football team, to be named St. Domingo’s F.C.&nbsp;
Such is the popularity of the sport that even in 1879, people couldn’t wait to help support or play on the new team.

